import React from "react";
import styled from "styled-components";
import { user } from "../config/api.js";

const Wrapper = styled.div`
  width: 874px;
  height: calc(100% - 112px);
  margin: 32px auto 0;
  background-color: #fff;
  border-top-left-radius: 20px;
  border-top-right-radius: 20px;
  border: 2px solid #ccc;
`;

const PublicKey = styled.div`
  border-bottom: 2px solid #ccc;
  height: 84px;
  .info {
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    height: 100%;
  }
  .info .name {
    font-size: 20px;
    font-weight: bold;
  }
  .info .key {
    font-size: 18;
    font-weight: medium;
  }
`;

const FunctionWrapper = styled.div`
  border-bottom: 2px solid #ccc;
  height: 310px;
`;

const AAWrapper = styled.div`
  display: flex;
  flex-direction: row;
  .title {
    font-size: 20px;
    font-weight: medium;
    line-height: 24px;
    color: #666;
    width: calc(100% / 2);
    border-bottom: 2px solid #ccc;
    height: 52px;
    display: flex;
    justify-content: center;
    align-items: center;
  }
  .title.active {
    color: #000;
    font-weight: bold;
    border-bottom: 4px solid #000;
  }
`;

export default function Dashboard() {
  return (
    <Wrapper>
      <PublicKey>
        <div className="info">
          <span className="name">{user.name}</span>
          <span className="key">
            0x{user.publicKey.substring(0, 4)}...
            {user.publicKey.substring(29, 34)}
          </span>
        </div>
      </PublicKey>
      <FunctionWrapper></FunctionWrapper>
      <AAWrapper>
        <div className="title active">Tài sản</div>
        <div className="title">Hoạt động</div>
      </AAWrapper>
    </Wrapper>
  );
}
